import React from "react";
import { useNavigate, Link } from "react-router-dom";

function Header() {
  const navigate = useNavigate();
  return (
    <div className="Header">
      <Link to="/communitylist">adhunter link</Link>
      <div>
        <button
          onPress={() => {
            navigate("/");
          }}
        >
          로그아웃
        </button>
      </div>
    </div>
  );
}

export default Header;
